/*Table structure for table `sys_companies` */

DROP TABLE IF EXISTS `sys_companies`;

CREATE TABLE `sys_companies` (
  `syc_id` smallint(6) NOT NULL AUTO_INCREMENT,
  `syc_code` varchar(10) NOT NULL,
  `syc_name` varchar(50) NOT NULL,
  `syc_country_id` smallint(6) NOT NULL,
  `syc_web_site` varchar(250) DEFAULT NULL,
  `syc_remarks` varchar(250) DEFAULT NULL,
  `syc_account_no` varchar(100) DEFAULT NULL,
  `syc_registration_no` varchar(100) DEFAULT NULL,
  `syc_vat_no` varchar(100) DEFAULT NULL,
  `syc_svat_no` varchar(100) DEFAULT NULL,
  `syc_working_day_type` varchar(32) DEFAULT NULL COMMENT 'this use to determine which days are working days to calculate leave days. value must be seperated by comma eg. 1,2,5',
  `syc_base_currency_id` smallint(6) DEFAULT NULL,
  `syc_tax_applicable` tinyint(4) DEFAULT NULL COMMENT '1-tax portion send to activated tax account, 0-tax portion addition to unit price',
  `syc_nopay_consider` tinyint(4) DEFAULT '0' COMMENT '0-nopay amount neglected, 1-nopay amount deduct from salary',
  `syc_menu_order` varchar(100) DEFAULT 'transaction, report, master' COMMENT 'menu behaviour seperated by comma',
  `syc_status` smallint(6) NOT NULL DEFAULT '1',
  `syc_is_deleted` tinyint(4) DEFAULT '0' COMMENT '0-Not Deleted, 1-deleted',
  `syc_created_by` smallint(6) DEFAULT NULL,
  `syc_created_on` int(11) DEFAULT NULL,
  `syc_last_modified_by` smallint(6) DEFAULT NULL,
  `syc_last_modified_on` int(11) DEFAULT NULL,
  `syc_deleted_by` smallint(6) DEFAULT NULL,
  `syc_deleted_on` int(11) DEFAULT NULL,
  PRIMARY KEY (`syc_id`),
  UNIQUE KEY `Company Code` (`syc_code`),
  UNIQUE KEY `Company Name` (`syc_name`),
  KEY `companies_country` (`syc_country_id`),
  KEY `companies_currency` (`syc_base_currency_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=latin1;

/*Data for the table `sys_companies` */

insert  into `sys_companies`(`syc_id`,`syc_code`,`syc_name`,`syc_country_id`,`syc_web_site`,`syc_remarks`,`syc_account_no`,`syc_registration_no`,`syc_vat_no`,`syc_svat_no`,`syc_working_day_type`,`syc_base_currency_id`,`syc_tax_applicable`,`syc_nopay_consider`,`syc_menu_order`,`syc_status`,`syc_is_deleted`,`syc_created_by`,`syc_created_on`,`syc_last_modified_by`,`syc_last_modified_on`,`syc_deleted_by`,`syc_deleted_on`) values (1,'CCB','Coconut Cultivation Board',204,'','','','','','','',1,1,1,'transaction, report, master',1,0,NULL,NULL,1,1559959579,NULL,NULL);

