/*Table structure for table `sys_location` */

DROP TABLE IF EXISTS `sys_location`;

CREATE TABLE `sys_location` (
  `syl_id` smallint(6) NOT NULL AUTO_INCREMENT,
  `syl_code` varchar(10) NOT NULL,
  `syl_name` varchar(50) NOT NULL,
  `syl_address` varchar(250) DEFAULT NULL,
  `syl_street` varchar(200) DEFAULT NULL,
  `syl_city` varchar(200) DEFAULT NULL,
  `syl_phone_no` varchar(100) DEFAULT NULL,
  `syl_fax_no` varchar(100) DEFAULT NULL,
  `syl_email` varchar(250) DEFAULT NULL,
  `syl_attendance_format` varchar(32) DEFAULT NULL COMMENT 'Payroll attendance input format (Excel Format 1, Text Format 1, Text Format 2)',
  `syl_zip_code` varchar(10) DEFAULT NULL,
  `syl_remarks` varchar(250) DEFAULT NULL,
  `syl_status` smallint(6) NOT NULL DEFAULT '1',
  `syl_is_deleted` tinyint(4) DEFAULT '0' COMMENT '0-Not Deleted, 1-Deleted',
  `syl_company_id` smallint(6) NOT NULL,
  `syl_created_by` smallint(6) DEFAULT NULL,
  `syl_created_on` int(11) DEFAULT NULL,
  `syl_last_modified_by` smallint(6) DEFAULT NULL,
  `syl_last_modified_on` int(11) DEFAULT NULL,
  `syl_deleted_by` smallint(6) DEFAULT NULL,
  `syl_deleted_on` int(11) DEFAULT NULL,
  PRIMARY KEY (`syl_id`),
  UNIQUE KEY `Locations Code` (`syl_code`,`syl_company_id`),
  UNIQUE KEY `Locations Name` (`syl_name`,`syl_company_id`),
  KEY `locations_company` (`syl_company_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=latin1;

/*Data for the table `sys_location` */

