/*Table structure for table `sys_menus` */

DROP TABLE IF EXISTS `sys_menus`;

CREATE TABLE `sys_menus` (
  `sym_id` int(11) NOT NULL AUTO_INCREMENT,
  `sym_code` varchar(10) DEFAULT NULL,
  `sym_parent_id` int(11) NOT NULL,
  `sym_name` varchar(100) NOT NULL,
  `sym_url` varchar(255) DEFAULT NULL,
  `sym_status` tinyint(4) NOT NULL DEFAULT '0',
  `sym_order_by` tinyint(4) DEFAULT '0',
  `sym_show_menu` tinyint(4) DEFAULT '1' COMMENT '0-Hide From Menu, 1- Display on menu',
  `sym_view` tinyint(4) NOT NULL DEFAULT '0' COMMENT 'View',
  `sym_list` tinyint(4) DEFAULT '0' COMMENT 'Listing',
  `sym_add` tinyint(4) NOT NULL DEFAULT '0' COMMENT 'Add',
  `sym_edit` tinyint(4) NOT NULL DEFAULT '0' COMMENT 'Edit',
  `sym_delete` tinyint(4) NOT NULL DEFAULT '0' COMMENT 'Delete',
  `sym_approval_1` tinyint(4) NOT NULL DEFAULT '0' COMMENT '1st Approval',
  `sym_approval_2` tinyint(4) NOT NULL DEFAULT '0' COMMENT '2nd Approval ',
  `sym_approval_3` tinyint(4) NOT NULL DEFAULT '0' COMMENT '3rd Approval',
  `sym_approval_4` tinyint(4) NOT NULL DEFAULT '0' COMMENT '4th Approval',
  `sym_approval_5` tinyint(4) NOT NULL DEFAULT '0' COMMENT '5th Approval',
  `sym_send_to_approval` tinyint(4) NOT NULL DEFAULT '0' COMMENT 'Send to Approval',
  `sym_print` tinyint(4) NOT NULL DEFAULT '0' COMMENT 'Print',
  `sym_reject` tinyint(4) NOT NULL DEFAULT '0' COMMENT 'Reject',
  `sym_revise` tinyint(4) NOT NULL DEFAULT '0' COMMENT 'Revise',
  `sym_admin_right` tinyint(4) DEFAULT '0' COMMENT 'Special Admin authentication Check',
  `sym_copy_to_clipboard` tinyint(4) DEFAULT '0' COMMENT 'Copy to Clipboard',
  `sym_export_to_excel` tinyint(4) NOT NULL DEFAULT '0' COMMENT 'Export to Excel',
  `sym_export_to_pdf` tinyint(4) NOT NULL DEFAULT '0' COMMENT 'Export To PDF',
  `sym_without_permission` tinyint(4) NOT NULL DEFAULT '0',
  `sym_behaviour` varchar(64) DEFAULT 'transaction' COMMENT 'transaction, master, report',
  `sym_awesome_icon` varchar(64) DEFAULT 'fa-list' COMMENT 'awesome icon name',
  `sym_module` varchar(64) NOT NULL DEFAULT 'system' COMMENT 'administration, hrm, dms, finance, inventory, payroll, pms, procurement, trining, transport',
  PRIMARY KEY (`sym_id`),
  UNIQUE KEY `index_code_menus` (`sym_code`),
  KEY `sym_url` (`sym_url`,`sym_parent_id`)
) ENGINE=InnoDB AUTO_INCREMENT=9006 DEFAULT CHARSET=latin1;

